def sudoku(mat, N):
  solver = pywraplp.Solver.CreateSolver('SCIP')

  matriz = {}
  for i in range(N**2):
    matriz[i] = {}
    for j in range(N**2):
      matriz[i][j] = {}
      for c in range(N**2):
        matriz[i][j][c] = solver.BoolVar("matriz[%i][%i][%i]" % (i,j,c))

  # nao alterar numeros que ja estao atribuidos
  for x in range(N**2):
    for y in range(N**2):
      for c in range(N**2):
        if mat[y][x][c] == 1:
          solver.Add(matriz[y][x][c] == 1)

  # garantir que todos tem numero
  for x in range(N**2):
    for y in range(N**2):
      solver.Add(sum([matriz[y][x][c] for c in range(N**2)]) == 1)

  # ligar linhas
  for y in range(N**2):
    for c in range(N**2):
      solver.Add(sum([matriz[y][x][c] for x in range(N**2)]) <= 1)

  # ligar colunas
  for x in range(N**2):
    for c in range(N**2):
      solver.Add(sum([matriz[y][x][c] for y in range(N**2)]) <= 1)

  # ligar quadrados
  for limx in range(0,N**2,N):
    for limy in range(0,N**2,N):
      for c in range(N**2):
        solver.Add(sum([matriz[y][x][c] for x in range(limx, limx+N) for y in range(limy, limy+N)]) <= 1)

  r = solver.Solve()
  #if r == pywraplp.Solver.OPTIMAL:
    #print("Sim")
  #else:
    #print("Nao")


  for y in range(N**2):
    for x in range(N**2):
      for c in range(N**2):
        mat[y][x][c] = round(matriz[y][x][c].solution_value())


